import { useState } from 'react';
import MyBotton from './components/UI/button/MyButton';
import ModalWindow from './components/UI/modal/ModalWindow'
import './styles/App.css';

function App() {
  const [modalWindow, setModalWindow] = useState(false);

  return (
    <div className="App"> 
      <ModalWindow visible={modalWindow} setVisible={setModalWindow}>
        <h3>Отзыв</h3>
        <h4>Как вас зовут?</h4>
        <h4>Все ли вам понравилось?</h4>
      </ModalWindow>
      <div className="head"></div>
      <div className="line"></div>
      <div className="body">
        <h1 className="welcome">Добро пожаловать в Академию!</h1>
        <div className="reviews-block">
          <h2 className="reviews">Отзывы</h2>
          <MyBotton onClick={() => setModalWindow(true)}></MyBotton>
        </div>
      </div>
      <div className="footer"></div>
    </div>
  )
}

export default App;
